:- discontiguous shape/3.
:- discontiguous posX_t0/3.
:- discontiguous posY_t0/3.
:- discontiguous displ/3.
:- discontiguous move_left_of/4.
:- discontiguous left_of_shape/4.
:- discontiguous shape_posX_t0/4.
:- discontiguous left_of/4.
:- discontiguous posX_t1/3.
:- discontiguous posY_t1/3.

%Types
base(shape(w,id,sh)).
base(posX_t0(w,id,x)).
base(posY_t0(w,id,x)).
base(displ(w,id,x)).
base(move_left_of(w,id,id,b)).
base(left_of_shape(w,id,id,sh)).
base(shape_posX_t0(w,id,sh,x)).
base(left_of(w,id,id,b)).
base(posX_t1(w,id,x)).
base(posY_t1(w,id,x)). 
  
%Modes

mode(displ, none, shape(+,+,-)).
mode(displ, none, posX_t0(+,+,-)).
mode(displ, maxMod, (left_of(+,+,-,true),shape(+,+,-))).
mode(displ, avg, (left_of(+,+,-,true),posX_t0(+,+,-))).
%mode(displ, min, (left_of(+,+,-,true),posX_t0(+,+,-))).
%mode(displ, max, (left_of(+,+,-,true),posX_t0(+,+,-))).
%mode(displ, avg, (left_of_shape(+,+,-,+),posX_t0(+,+,-))).
%mode(displ, avg, (left_of(+,+,-,true),shape_posX_t0(+,+,+,-))).
%mode(displ, avg, (left_of_shape(+,+,-,c),posX_t0(+,+,-))).
%mode(displ, min, (left_of_shape(+,+,-,c),posX_t0(+,+,-))).
%mode(displ, max, (left_of_shape(+,+,-,c),posX_t0(+,+,-))).

  
mode(posX_t1, none, displ(+,+,-)).
mode(posX_t1, none, posX_t0(+,+,-)).


mode(posY_t1, none, posY_t0(+,+,-)).

%Aggregations
agg(none).
agg(avg).
agg(min).
agg(max).
agg(maxMod).
agg(minMod).

%Declare the type of random variables
thres(shape, 3, discrete, [square,triangle,circle]).
thres(posX_t0, 3, continuous, []).
thres(posY_t0, 3, continuous, []).
thres(displ, 3, continuous, []).
thres(move_left_of, 4, discrete, [true,false]).
thres(left_of, 4, discrete, [true,false]).
thres(posX_t1, 3, continuous, []).
thres(posY_t1, 3, continuous, []).
thres(left_of_shape,4,discrete, [square,triangle,circle]).
%thres(shape_posX_t0,3,discrete, [square,triangle,circle]).
thres(shape_posX_t0,4,continuous, []).

%List the name of all random variables
randomVariableNames([posX_t0, posY_t0, displ, shape, posX_t1, posY_t1, move_left_of,left_of]).

%Rank declaration
%Only clauses of the form {h ~ D := b1, ..., bn, where rank(bi) < rank(h)} will be generated.
rank([posX_t1, posY_t1, displ, move_left_of, left_of, shape, posX_t0, posY_t0]).

%Target
learn(displ, 3, 3, continuous). 
learn(posX_t1, 3, 3, continuous).
learn(posY_t1, 3, 3, continuous).

left_of_shape(W,I1,I2,Sh) :-
  left_of(W,I1,I2,true),
  shape(W,I2,Sh).
shape_posX_t0(W,I,Sh,X) :-
  shape(W,I,Sh),
  posX_t0(W,I,X).

